import "./topbar.css"

function isUser(user) {
    if (user && user.username) return user.username;
    return "";
  }

const TopBar = (props) => {
    return (
      <div className="navbar">
        <div className="wrapper">
          <div className="items">
            <div className="item">
              {isUser(props.user)}
            </div>
          </div>
        </div>
      </div>
    );
  };

export default TopBar;
